import React from 'react'
import Head from 'next/head'



const Home: React.FC = () => {

  function alerta() {
    alert("Teste")
  }

  return (
    <div className="container">
      <Head>
        <title>PrimeNext - NextJS</title>
      </Head>

      <div className="card">
        <h3>Range IP - Primefox</h3>
        <input type="text" placeholder="Digite Host ou IP" onClick={alerta} />
      </div>

      <div className="bottom">
        <a href="http://primefox.com.br">Primefox</a>
      </div>

    </div>
  )
}

export default Home;
